import React, { useState } from 'react';
import './Slider.css';
import { SliderData } from './SliderData';

function Slider() {

	return (
		<>
            {SliderData.map((slide,index)=>{
				return (
					<img src={slide.image} alt="travel image"/>
				)
			})}
		</>
	)
}

export default Slider;
